import React from "react";
import {
  Button,
  Container,
  Grid,
  Header,
  Icon,
  Image,
  Item,
  Label,
  Menu,
  Segment,
  Step,
  Table,
} from 'semantic-ui-react'

import teamImg from "../assets/team.svg";
import shareImg from "../assets/share.svg";
import upvoteImg from "../assets/upvote.svg";

const HomeCards = () => {
  return (
    <Segment style={{ padding: '8em 0em' }} vertical>
      <Grid columns={3} stackable>
      <Grid.Row>
        <Grid.Column>
        <Image src={teamImg} width="100%" height="375" alt="Team" />
        <Header
      as='h3'
      content='Search for hackathons'/>
        </Grid.Column>
        <Grid.Column>
        <Image src={shareImg} width="100%" height="375" alt="Team" />
        </Grid.Column>
        <Grid.Column>
        <Image src={upvoteImg} width="100%" height="375" alt="Team" />
        </Grid.Column>
      </Grid.Row>
      </Grid>
    <div class="ui three column stackable grid">
      <div class="column">
        <div class="image">
        <img src={teamImg} width="100%" height="400" alt="Team" />

        </div>
        <div class="center content">
        <h1 className="center">Search for hackathons</h1>
        </div>
      </div>

      <div class="column">
        <div class="image">
        <img src={shareImg} width="100%" height="400" alt="Share" />
        </div>
        <div class="center content">
        <h1 className="center">Share your experiences anonymously</h1>
        </div>
      </div>

      <div class="column">
        <div class="image">
        <img src={upvoteImg} width="100%" height="400" alt="Upvote" />
        </div>
        <div class="center content">
        <h1 className="center">Support others' reviews</h1>
        </div>
      </div>
    </div>
    </Segment>
  );
};

export default HomeCards;

